```function url_post(url, parametros, chuta, casca) {
    let usp = new URLSearchParams(parametros);
    fetch(url,
        {
            mode: 'no-cors', 
            method: 'POST',
            body: usp,
            headers: { "Content-Type": "application/x-www-form-urlencoded" }
        })
        .then(resultado =&gt; resultado.ok ? Promise.all([resultado.text(), resultado]) : Promise.reject(new Error(resultado.statusText)))
        .then(([texto, resultado]) =&gt; chuta(texto, resultado))    
        .catch(error =&gt; casca(error));
}```

